import './Footer.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

import { Col, Container, Row } from "react-bootstrap";

function Footer(){

    const ArraysOfFooter = [{
        id: 1,
        title: 'Social',
        list1: 'Facebook',
        list2: 'Twitter',
        list3: 'KickStarter',
        list4: 'Vimeo'
    },
    {
        id: 2,
        title: 'About',
        list1: 'Style Guide',
        list2: 'Features',
        list3: 'Contact',
        list4: '404'
    },
    {
        id: 3,
        title: 'Features',
        list1: 'Demos',
        list2: 'Light Version',
        list3: 'Sepia Version',
        list4: 'Dark Version'
    }];
    const ArraysOfFooterOnMap = ArraysOfFooter.map((ArrayOfFooter) => 
    <Col key = {ArrayOfFooter.id} lg = "2" md = "4" sm = "4">
        <h3>{ArrayOfFooter.title}</h3>
        <ul className = "footer-list">
            <li>{ArrayOfFooter.list1}</li>
            <li>{ArrayOfFooter.list2}</li>
            <li>{ArrayOfFooter.list3}</li>
            <li>{ArrayOfFooter.list4}</li>
        </ul>
    </Col>
    )

    return(
        <Container fluid>
            <Row>
                {ArraysOfFooterOnMap}
            </Row>
        </Container>
    )
}

export default Footer
